import React from 'react'
import {connect} from 'react-redux'
import {createStream,editStream, fetchStream,fetchStreams, deleteStream,} from '../../actions'

class StreamList extends React.Component {

	render(){
		return(
			<div>StreamList</div>
		)
	}

}

export default connect(null, {createStream, deleteStream, editStream, fetchStreams, fetchStream})(StreamList);
